import axios from "axios";
import { Fragment, useEffect, useState } from "react";

const YoutubeApp1213 = () => {
  console.log('YoutubeApp1213')

  const [videos, setVideos] = useState([])
  const [params, setParams] = useState({
    part : 'snippet',
    chart : 'mostPopular',
    maxResult:25,
    key : "AIzaSyAF_QeapaYa0SO4Q4RLivzjodBExQ8HsZQ"
  })

  useEffect(() => {
    console.log('effect')
    axios.get('https://www.googleapis.com/youtube/v3/videso?',{params})
    .then(result => {
      console.log(result.data.items)
    }).catch(error => console.log(error))
  }, []) // 의존성배열리 깡통이면 최초 한번만 실행된다.
  console.log(videos)

  return (
    <Fragment>
      <h1>Hello React</h1>
    </Fragment>
  );
}

export default YoutubeApp1213;
